import {useEffect} from "react";
import axios from "axios";
import {connect} from "react-redux";
import Layout from "../components/Layout";
import {reauthenticate, getCookie, getProfile} from "../redux/authActions";

const Profile = ({reauthenticate, getCookie, user, getProfile}) => {
    useEffect(() => {
        getProfile();
    }, []);

    return (
        <Layout title="Profile Page">
            <h1>Profile Page</h1>
        </Layout>
    )
}

const mapStateToProps = ({authentication}) => {
    return {
        profile: authentication.profile
    }
}

export default connect(mapStateToProps, {reauthenticate, getProfile})(Profile);
